                let p = """"
                fetch(`/Employee/GetProgammingLanguage/${id}`)
                    .then(res => res.json())
                    .then(data => {

                        $.each(data, function(key, val) {

                            p += ` <option value=""${val.id}"" >${val.name
                                }</option>`

                        });
                        $("".programming"").html(p)
                    })
            });
        })
    </script>
